catalog_script_client.script:
function onChange(control, oldValue, newValue, isLoading) {
	if (isLoading || newValue == '') {
		return;
	}
	var prodModel = g_form.getValue('product_model');
	var serNumber = g_form.getValue('serial_number');

	if (oldValue != newValue && prodModel){
		g_form.clearValue('product_model');
	}
	if (oldValue != newValue && serNumber){
		g_form.clearValue('serial_number');
	}

}
